import React from "react";
import {
  ResponsiveContainer,
  PieChart,
  Pie,
  Cell,
  Tooltip,
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
} from "recharts";

const dataPie = [
  { name: "Utilisateurs", value: 400 },
  { name: "RÃ©servations", value: 300 },
  { name: "Commandes", value: 300 },
  { name: "Messages", value: 200 },
];

const COLORS = ["#0088FE", "#00C49F", "#FFBB28", "#FF8042"];

const dataBar = [
  { name: "Jan", uv: 400, pv: 2400, amt: 2400 },
  { name: "FÃ©v", uv: 300, pv: 1398, amt: 2210 },
  { name: "Mars", uv: 200, pv: 9800, amt: 2290 },
  { name: "Avr", uv: 278, pv: 3908, amt: 2000 },
  { name: "Mai", uv: 189, pv: 4800, amt: 2181 },
];

export default function DashboardWow() {
  return (
    <div style={{ maxWidth: 900, margin: "auto", padding: 20, fontFamily: "Segoe UI, Tahoma, Geneva, Verdana, sans-serif" }}>
      <h1 style={{ textAlign: "center", marginBottom: 40 }}>Dashboard Wow ðŸŽ‰</h1>

      <div style={{ display: "flex", justifyContent: "space-around", marginBottom: 50 }}>
        <ResponsiveContainer width={350} height={300}>
          <PieChart>
            <Pie
              data={dataPie}
              cx="50%"
              cy="50%"
              labelLine={false}
              label={({ name, percent }) => `${name}: ${(percent * 100).toFixed(0)}%`}
              outerRadius={100}
              fill="#8884d8"
              dataKey="value"
              isAnimationActive={true}
            >
              {dataPie.map((entry, index) => (
                <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
              ))}
            </Pie>
            <Tooltip />
          </PieChart>
        </ResponsiveContainer>

        <ResponsiveContainer width={450} height={300}>
          <BarChart
            data={dataBar}
            margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
            isAnimationActive={true}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="uv" fill="#82ca9d" />
            <Bar dataKey="pv" fill="#8884d8" />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}
